import axios from "axios";

export const Sign_In = async (user) => {
  return axios.post(`${process.env.SERVER_URL}/auth/login`, user);
};

export const SignUp = async (user) => {
  return axios.post(`${process.env.SERVER_URL}/auth/registration`, user);
};
